column8:
カピス貝を使った COQUILLAGE SHELL シリーズは、上品なシェルの輝きが大人の雰囲気のLEDキャンドルライト。<br>
底にあるスイッチを入れるとＬＥＤの光がゆらゆらと光り、息を吹きかけると空気の振動によって灯りが消え、再度吹きかけると点灯します。<br>
電球の周りは本物のアロマキャンドル素材を使っているので、Sea Shoreの爽やかな香りがほんのりと広がります。<br>
火を使わないから、熱くならず安全で、重ねたり棚の中に入れたりして使用できます。<br>
<br>
<b>【　仕　様　】</b><br>
カラー：ゴールド<br>
素材：カピス貝、キャンドル　LED電球<br>
サイズ：φ105 h200 単3電池2本使用（電池は付属しません）<br>
重量：900g<br>
香り：SEASHORE / 爽やかで清涼な香り<br>
<br>

<br>
