海や夏のディスプレイにぴったりなヒトデ型LEDキャンドル。<br>
暗闇で灯した姿は本物のヒトデが光っているようなロマンチックな雰囲気に。<br>
商品本体は、本物のロウソクを使っています。<br>
<br>
<b>【　仕　様　】</b><br>
